import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

import Main from "./Pages/Home/Home";
import Login from "./Pages/Login/Login";
import Register from "./Pages/Login/Register";
import Dashboard from "./Pages/Dashboard/dashboard/dashboard.js";
import User from "./Pages/Dashboard/user.js";
import ZapFeed from "./Pages/Dashboard/ZapFeed/ZapFeed";
import Invoicing from "./Pages/Dashboard/invoicing/invoicing.js";
import Campaigns from "./Pages/Dashboard/Campaigns/campaigns";
import Search from "./Pages/Dashboard/Search/search";
import Trackers from "./Pages/Dashboard/Trackers/trackers.js";
import CompanyList from "./Pages/Dashboard/company/index.js";

import BlitzPay from "./Pages/BlitzPay/blitzpay.js";
import AddCreators from "./Pages/Dashboard/Campaigns/addCreators.js"; // Adjust the path as necessary
import routes from "./Config/routes.js";
import PrivateRoute from "./Lib/private-route.js";
import { Hydrate, QueryClient, QueryClientProvider } from "react-query";

const Home = React.lazy(() => import("./Pages/Home/Home"));

function App() {
  const queryClient = new QueryClient();

  return (
    <QueryClientProvider client={queryClient}>
      <Router>
        <Routes>
          <Route
            exact
            path={routes.base}
            element={<Navigate to={routes.home} />}
          />
          <Route
            path={routes.home}
            element={
              <Main>
                <Home />
              </Main>
            }
          />
          <Route path={routes.login} element={<Login />} />
          <Route path={routes.register} element={<Register />} />
          <Route
            path={routes.dashboard}
            element={
              <PrivateRoute>
                <Dashboard />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.user}
            element={
              <PrivateRoute>
                <User />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.Trackers}
            element={
              <PrivateRoute>
                <Trackers />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.invoicing}
            element={
              <PrivateRoute>
                <Invoicing />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.campaigns}
            element={
              <PrivateRoute>
                <Campaigns />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.search}
            element={
              <PrivateRoute>
                <Search />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.blitzpay}
            element={
              <PrivateRoute>
                <BlitzPay />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.addCreators}
            element={
              <PrivateRoute>
                <AddCreators />
              </PrivateRoute>
            }
          />
          <Route
            path={routes.company}
            element={
              <PrivateRoute>
                <CompanyList />
              </PrivateRoute>
            }
          />
          <Route path="*" element={<Navigate to={routes.home} />} />
        </Routes>
      </Router>
    </QueryClientProvider>
  );
}

export default App;
